import { Injectable } from '@angular/core';
import {HttpClient, HttpHeaders, HttpParams, HttpResponse} from "@angular/common/http";
import {Observable} from "rxjs";

export interface BundleItems {
  amount: number;
  sms: number;
  call: number;
  data: number;
  priorities: Map<string, number>;
}

export interface Bundle {
  bundle: Map<string, BundleItems>
}

@Injectable({
  providedIn: 'root'
})
export class UserplanService {
  constructor(private http: HttpClient) {}
  Hemle:Array<any>=new Array<any>();
  hemles!:Bundle[];
  Mango:any;
  public showPlan(plan:any): Observable<any>
  {
    const headers = new HttpHeaders({ 'Content-Type': 'application/json' });
    const url='http://127.0.0.1:8000/api/choices/';
    return this.http.post<BundleList>(url,plan,{headers});
  }
  public setHemle(obj:BundleList){
    // for(var [key,value] of obj) {
    //   this.Hemle.push(obj)
    // }
    this.hemles=obj;
    console.log("hemle service",this.hemles);
  }
  public SetMango(obj:any){
  this.Mango=obj;
  }
  public getHemle(): BundleList{
    return this.hemles;
  }
  public getMango(){
    return this.Mango;
  }
}
